import React from 'react'

const CoinLayout = ({ coin }) => {
    return (
        <div key={coin.id}>
            <div>{coin.score}</div>
            <div>{coin.name}</div>
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    var TrendingCoin = []
    TrendingJSON.forEach((coin) => {
        TrendingCoin.push(<CoinLayout coin={coin}/>)
    })
    return (
        <div>
            <div>Trending right now</div>
            {TrendingCoin}
        </div>
    )
}

export default Home
